import Car from "../Models/Car"
import '../../styles/list/Cars.scss'

const CarList = props => {
    return (
        <div className="BodySceleton">
             <div className="sceletonList">
                  <div className="list">
                      {props.cars.map((car, index) => <Car car={car} key={index} /> )}
                  </div>
              </div>
        </div>
    )
}

export default CarList
